import axios from "axios";
import { Component } from "react";

const Home = () => {
  axios
    .get("http://localhost:5000/marcacoes")
    .then((res) => {
      const marcacoes = res.data;
      marcacoes.json();
    })
    .then(marcacoes.json());

  return (
    <>
      <h2>Home</h2>
    </>
  );
};

export default Home;
